create table point
(
  id        bigint auto_increment
    primary key,
  addres    varchar(255) null,
  latitude  double       null,
  longitude double       null,
  name      varchar(255) null,
  typeId    bigint       null,
  constraint point_ibfk_1
    foreign key (typeId) references bizType (id)
);

create index typeId
  on point (typeId);

